import React from "react";

export default function About() {
  return (
    <div className="about-container">
      <h1>About</h1>
      <p>
        Arizona State University graduate student with a Master Degree in
        Digital Culture, and a Bachelor's Degree in Computer Information
        Systems. I am from China and fluent in English, Mandarin, and Cantonese.
      </p>
    </div>
  );
}
